struct AdminItem {
    string itemTitle;
    uint startingPrice;
    bool auctionClosed;
}

struct AdminUser {
    string userName;
    address payable userWallet;
    // uint userBid;
}

struct AdminBid {
    address bidderWallet;
    uint bidPlaced;
}

